import React from "react";
import "owl.carousel/dist/assets/owl.carousel.css";
import "owl.carousel/dist/assets/owl.theme.default.css";
import $ from "jquery";
import "owl.carousel";

class Package extends React.Component {
  componentDidMount() {
    // Initialize Owl Carousel
    $(".packages-carousel").owlCarousel({
      loop: true,
      margin: 30,
      nav: true,
      dots: true,
      autoplay: true,
      autoplayTimeout: 30000, // 30 seconds
      responsive: {
        0: {
          items: 1,
        },
        768: {
          items: 2,
        },
        992: {
          items: 3,
        },
      },
    });
  }

  render() {
    return (
      <>
        {/* Packages Start */}
        <div className="container-fluid packages py-5">
          <div className="container py-5">
            <div className="mx-auto text-center mb-5" style={{ maxWidth: 900 }}>
              <h5 className="section-title px-3">Packages</h5>
              <h1 className="mb-0">Awesome Packages</h1>
            </div>
            <div className="packages-carousel owl-carousel">
              {[...Array(4)].map((_, index) => (
                <div className="packages-item" key={index}>
                  <div className="packages-img">
                    <img
                      src={`img/packages-${index + 1}.jpg`}
                      className="img-fluid w-100 rounded-top"
                      alt="Package"
                    />
                    <div
                      className="packages-info d-flex border border-start-0 border-end-0 position-absolute"
                      style={{ width: "100%", bottom: 0, left: 0, zIndex: 5 }}
                    >
                      <small className="flex-fill text-center border-end py-2">
                        <i className="fa fa-map-marker-alt me-2" />
                        Location - {index === 0 ? "Venice, Italy" : "Other"}
                      </small>
                      <small className="flex-fill text-center border-end py-2">
                        <i className="fa fa-calendar-alt me-2" />
                        3 Days
                      </small>
                      <small className="flex-fill text-center py-2">
                        <i className="fa fa-user me-2" />
                        2 Person
                      </small>
                    </div>
                    <div className="packages-price py-2 px-4">
                      ${349 + index * 100}.00
                    </div>
                  </div>
                  <div className="packages-content bg-light">
                    <div className="p-4 pb-0">
                      <h5 className="mb-0">
                        {index === 0 ? "Venice, Italy" : "Discover Place"}
                      </h5>
                      <small className="text-uppercase">Hotel Deals</small>
                      <div className="mb-3">
                        {Array(5)
                          .fill()
                          .map((_, starIndex) => (
                            <small
                              className="fa fa-star text-primary"
                              key={starIndex}
                            />
                          ))}
                      </div>
                      <p className="mb-4">
                        Lorem ipsum dolor sit amet, consectetur adipisicing
                        elit. Nesciunt nemo quia quae illum aperiam fugiat
                        voluptatem repellat.
                      </p>
                    </div>
                    <div className="row bg-primary rounded-bottom mx-0">
                      <div className="col-6 text-start px-0">
                        <a
                          href="#"
                          className="btn-hover btn text-white py-2 px-4"
                        >
                          Read More
                        </a>
                      </div>
                      <div className="col-6 text-end px-0">
                        <a
                          href="#"
                          className="btn-hover btn text-white py-2 px-4"
                        >
                          Book Now
                        </a>
                      </div>
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>
        {/* Packages End */}
      </>
    );
  }
}

export default Package;
